import React from 'react';

import "../css/Countries.css";
import img from "../img/tierra_01.jpg";

function CardCountry({ id, imagen, nombre, continente, poblacion }) {
  return (
    <div className='content_card_country'>
      <div className='content_bandera'>
        <img src={img} alt='Imagen not found' className='img_bandera' />
      </div>
      <div className='content_title'>
        <h3>{nombre}</h3>
        <h4>{continente}</h4>
      </div>
      <h4>{number.toLocaleString('es-MX')}</h4>
    </div>
  )
}

export default CardCountry;
